// PatientReport.js

import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const PatientReport = () => {
    const { numero_atendimento } = useParams();
    const [patientData, setPatientData] = useState(null);

    useEffect(() => {
        const fetchPatientData = async () => {
            try {
                const response = await fetch(`http://127.0.0.1:8000/api/pacientes/${numero_atendimento}`);
                if (response.ok) {
                    const data = await response.json();
                    setPatientData(data);
                } else {
                    console.error('Failed to fetch patient data');
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        fetchPatientData();
    }, [numero_atendimento]);

    if (!patientData) {
        return <p>Loading...</p>;
    }

    return (
        <div>
            <h2>Patient Report</h2>
            <p>Number of Attendance: {patientData.numero_atendimento}</p>
            <p>Name: {patientData.nome_completo}</p>
            <p>Gender: {patientData.sexo}</p>
            {/* Display other patient details and exam data as needed */}
        </div>
    );
};

export default PatientReport;
